// src/admin/pages/Settings.js
import React from 'react';

const Settings = () => {
    return (
        <div className="container">
            <h2>Settings</h2>
            <form>
                <label>
                    Configuration Option:
                    <input type="text" />
                </label>
                <button type="submit">Save Changes</button>
                <button type="reset">Reset to Default</button>
            </form>
        </div>
    );
};

export default Settings;
